import React from "react";
import style from "./Card.module.css"


export default function Card({name, image, continent}) {
    return (
        <div className={style.container}>
            <h3>{name}</h3>
            <h3>{continent}</h3>
            <img src={image} alt="imagen de pais"/>
            <p>{image}</p>
        </div>
    );
}
